        <>
            <Parallax rate="1">
                {(para)=> (
                <Banner data={para}/>
                )}        
            </Parallax>

            <main>
                <Parallax rate="2">
                    {para => (
                    <Map data={para}/>
                    )}
                </Parallax>
                {carousels}
            {/* <Carousel object={data[0]}/> */}
                {/* <Section text="Creative writing" img={writingImg} />
                <Section text="Graphic Design" img={graphicImg} /> */}
                <Quote />
            </main>
        </>
    )
}

export default Home
